import React, { useEffect, useState } from 'react';
import { Navigate } from 'react-router-dom';
import { profileAPI } from '../services/api';
import LoadingSpinner from './ui/LoadingSpinner';
import { hasCompletedOnboardingFromProfile } from '../utils/onboardingUtils';

interface OnboardingGuardProps {
  children: React.ReactNode;
  requireOnboarding?: boolean; // true = must have completed onboarding, false = must NOT have completed
}

const OnboardingGuard: React.FC<OnboardingGuardProps> = ({ children, requireOnboarding = true }) => {
  const [loading, setLoading] = useState(true);
  const [hasCompletedOnboarding, setHasCompletedOnboarding] = useState(false);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const checkOnboardingStatus = async () => {
      try {
        console.log('üîç OnboardingGuard: Checking onboarding status...');
        console.log('üîç OnboardingGuard: requireOnboarding =', requireOnboarding);
        
        // First check if onboarding was just completed (immediate fallback)
        const justCompleted = localStorage.getItem('onboarding_just_completed');
        if (justCompleted === 'true') {
          console.log('üîç OnboardingGuard: Onboarding was just completed, allowing access');
          setHasCompletedOnboarding(true);
          setLoading(false);
          // Clear the just completed flag
          localStorage.removeItem('onboarding_just_completed');
          return;
        }
        
        // First, try a simple health check to test connectivity
        try {
          console.log('üîç OnboardingGuard: Testing profile API connectivity...');
          await profileAPI.health();
          console.log('üîç OnboardingGuard: Profile API is responsive');
        } catch (healthError: any) {
          console.warn('üîç OnboardingGuard: Profile API health check failed:', healthError.message);
          // Continue anyway, the main request might still work
        }
        
        // Try to get profile with retry mechanism
        let response: any = null;
        let retryCount = 0;
        const maxRetries = 2;
        
        while (retryCount <= maxRetries) {
          try {
            response = await profileAPI.get();
            break; // Success, exit retry loop
          } catch (retryError: any) {
            retryCount++;
            console.log(`üîç OnboardingGuard: Profile check attempt ${retryCount} failed:`, retryError.message);
            
            if (retryCount > maxRetries) {
              throw retryError; // Re-throw the error if we've exhausted retries
            }
            
            // Wait before retrying (exponential backoff)
            await new Promise(resolve => setTimeout(resolve, 1000 * retryCount));
          }
        }
        
        // Check if we got a valid response
        if (!response || !response.data) {
          throw new Error('No valid response received from profile API');
        }
        
        console.log('üîç OnboardingGuard: Full API response:', response.data);
        
        // Check if user has daily_calories set (key onboarding field)
        const profile = response.data.profile;
        const hasCompletedOnboardingFromAPI = response.data.hasCompletedOnboarding;
        
        // Use utility function for consistent onboarding completion check
        const completed = hasCompletedOnboardingFromProfile(profile);
        
        console.log('üîç OnboardingGuard: Profile object:', profile);
        console.log('üîç OnboardingGuard: daily_calories value:', profile?.daily_calories);
        console.log('üîç OnboardingGuard: daily_protein value:', profile?.daily_protein);
        console.log('üîç OnboardingGuard: hasCompletedOnboarding from API:', hasCompletedOnboardingFromAPI);
        console.log('üîç OnboardingGuard: Calculated completed:', completed);
        console.log('üîç OnboardingGuard: Final decision - Has completed onboarding:', completed);
        
        setHasCompletedOnboarding(completed);
        setError(null);
      } catch (error: any) {
        console.error('üîç OnboardingGuard: Error checking onboarding status:', error);
        console.error('üîç OnboardingGuard: Error response:', error.response);
        console.error('üîç OnboardingGuard: Error code:', error.code);
        console.error('üîç OnboardingGuard: Error message:', error.message);
        
        if (error?.response?.status === 404) {
          // No profile exists = hasn't completed onboarding
          console.log('üîç OnboardingGuard: No profile found (404) = not completed');
          setHasCompletedOnboarding(false);
        } else if (error.code === 'ERR_NETWORK' || error.message?.includes('Network Error') || error.code === 'ERR_FAILED') {
          // Network error or server down - check localStorage as fallback
          console.log('üîç OnboardingGuard: Network/server error, checking localStorage fallback');
          console.log('üîç OnboardingGuard: Error details:', { code: error.code, message: error.message });
          
          const onboardingCompleted = localStorage.getItem('onboarding_completed');
          const onboardingDate = localStorage.getItem('onboarding_completed_date');
          
          if (onboardingCompleted === 'true') {
            console.log('üîç OnboardingGuard: localStorage indicates onboarding completed on:', onboardingDate);
            setHasCompletedOnboarding(true);
            setError('Server temporarily unavailable - using cached data');
          } else {
            console.log('üîç OnboardingGuard: localStorage indicates onboarding not completed');
            setHasCompletedOnboarding(false);
            setError('Server temporarily unavailable - please try again');
          }
        } else {
          // For other errors, assume they haven't completed onboarding to be safe
          console.log('üîç OnboardingGuard: Error occurred, assuming not completed');
          setHasCompletedOnboarding(false);
          setError('Unable to verify onboarding status');
        }
      } finally {
        setLoading(false);
      }
    };

    checkOnboardingStatus();
  }, [requireOnboarding]);

  if (loading) {
    return <LoadingSpinner />;
  }

  // If we require onboarding to be completed but it's not
  if (requireOnboarding && !hasCompletedOnboarding) {
    console.log('üö´ OnboardingGuard: REDIRECT DECISION - Need onboarding completed but it is not');
    console.log('üö´ OnboardingGuard: requireOnboarding =', requireOnboarding, 'hasCompletedOnboarding =', hasCompletedOnboarding);
    console.log('üö´ OnboardingGuard: Redirecting to /onboarding');
    return <Navigate to="/onboarding" replace />;
  }

  // If we require onboarding to NOT be completed but it is
  if (!requireOnboarding && hasCompletedOnboarding) {
    console.log('üö´ OnboardingGuard: REDIRECT DECISION - Onboarding should not be completed but it is');
    console.log('üö´ OnboardingGuard: requireOnboarding =', requireOnboarding, 'hasCompletedOnboarding =', hasCompletedOnboarding);
    console.log('üö´ OnboardingGuard: Redirecting to /dashboard');
    return <Navigate to="/dashboard" replace />;
  }

  // Show error if there was one, but still allow access
  if (error) {
    console.warn('‚ö†Ô∏è OnboardingGuard: Proceeding despite error:', error);
  }

  console.log('‚úÖ OnboardingGuard: Access granted');
  return <>{children}</>;
};

export default OnboardingGuard;
